CREATE DATABASE IF NOT EXISTS wereldwijnen;
USE wereldwijnen;

DROP TABLE IF EXISTS landen;
CREATE TABLE landen (
  id int unsigned NOT NULL,
  naam varchar(50) NOT NULL,
  versie int unsigned not null default 0,
  PRIMARY KEY (id) USING BTREE,
  UNIQUE KEY Land(naam) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS soorten;
CREATE TABLE soorten(
  id int unsigned NOT NULL AUTO_INCREMENT,
  naam varchar(50) NOT NULL,
  landid int unsigned NOT NULL,
  versie int unsigned not null default 0,
  PRIMARY KEY (id) USING BTREE,
  KEY FK_soorten_landen(landid) USING BTREE,
  CONSTRAINT FK_soorten_landen FOREIGN KEY (landid) REFERENCES landen(id)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS wijnen;
CREATE TABLE wijnen (
  id int unsigned NOT NULL AUTO_INCREMENT,
  soortid int unsigned NOT NULL,
  jaar smallint unsigned NOT NULL,
  beoordeling tinyint unsigned NOT NULL,
  prijs decimal(9,2) NOT NULL,
  inBestelling int unsigned NOT NULL,
  versie int unsigned not null default 0,
  PRIMARY KEY (id) USING BTREE,
  KEY FK_wijnen_soorten(soortid) USING BTREE,
  CONSTRAINT FK_wijnen_soorten FOREIGN KEY (soortid) REFERENCES soorten(id)
) ENGINE=InnoDB AUTO_INCREMENT=1410 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS bestelbonnen;
CREATE TABLE bestelbonnen (
  id int unsigned NOT NULL AUTO_INCREMENT,
  besteld datetime NOT NULL,
  naam varchar(50) NOT NULL,
  straat varchar(50) NOT NULL,
  huisNr varchar(50) DEFAULT NULL,
  postCode varchar(50) NOT NULL,
  gemeente varchar(50) NOT NULL,
  bestelwijze smallint unsigned NOT NULL,
  versie int unsigned not null default 0,
  PRIMARY KEY (id) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS bestelbonlijnen;
CREATE TABLE bestelbonlijnen (
  bonid int unsigned NOT NULL,
  wijnid int unsigned NOT NULL,
  aantal int unsigned NOT NULL,
  prijs decimal(9,2) NOT NULL,
  KEY FK_bestelbonlijnen_bestelbonnen(bonid) USING BTREE,
  KEY FK_bestelbonlijnen_wijnen(wijnid) USING BTREE,
  CONSTRAINT FK_bestelbonlijnen_wijnen FOREIGN KEY (wijnid) REFERENCES wijnen(id),
  CONSTRAINT FK_bestelbonlijnen_bestelbonnen FOREIGN KEY(bonid) REFERENCES bestelbonnen(id)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

